CREATE TABLE `order_list` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `quantity` int(11) DEFAULT NULL,
  `order_transactions_id` int(11) DEFAULT NULL,
  `menu_items_id` int(11) DEFAULT NULL,
  `special_request_id` int(11) DEFAULT NULL,
  `request_type_id` int(11) DEFAULT NULL,
  `clear_status` varchar(45) DEFAULT NULL,
  `activated` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `order_transactions_id` (`order_transactions_id`),
